import React from "react";
import { Button } from 'react-bootstrap'

function Test2() {

    const testHandler = () => {
        alert("batata");
    }

    return (
        <div>
            <Button onClick={testHandler} variant="outline-success">test</Button>
        </div>
    )
}

export default Test2;
